import React, { Component } from 'react';
import { MDBBtn, MDBDataTable, MDBTableBody, MDBTableHead  } from 'mdbreact';

class ErrorLog extends Component {
    constructor (props) {
        super(props);
        this.state = {
            columns: [
                {
                    label: "Error ID",
                    field: "error",
                },
                {
                    label: "Description",
                    field: "description",
                    width: 400
                },
                {
                    label: "Flow",
                    field: "flow",
                    width: 80
                },
                {
                    label: "Error Type",
                    field: "type",
                    width: 80
                },
                {
                    label: "Emergency Level",
                    field: "emergency",
                    width: 80,
                }
            ],
            rows: [
                {
                    error: "00001",
                    description: "blablablablablablablablablablablablablablablablabla...",
                    flow: 12,
                    type: "A",
                    emergency: "general"
                },
                {
                    error: "00002",
                    description: "blablablablablablablablablablablablablablablablabla...",
                    flow: 12,
                    type: "D",
                    emergency: "urgent"
                },
                {
                    error: "00003",
                    description: "blablablablablablablablablablablablablablablablabla...",
                    flow: 12,
                    type: "B",
                    emergency: "priority"
                },
                {
                    error: "00004",
                    description: "blablablablablablablablablablablablablablablablabla...",
                    flow: 12,
                    type: "C",
                    emergency: "urgent"
                }
            ],
            totalCount: 0,
        }
    }
    render() {
        return (
            <div>
                <div className="container" style={{
                    backgroundColor: "#F7F7F7",
                    marginTop: "30px",
                    justifyContent: "center",
                    border: "1px solid #F7F7F7",
                    height: "35px"
                }}/>
                <div className="container" style={{
                    padding: "30px",
                    justifyContent: "center",
                    border: "1px solid #F7F7F7",
                    height: "110px"
                }}>
                    <h5 style={{
                        paddingLeft:"10px",
                        borderLeft: "5px solid #555555"
                    }}>Unread Errors</h5>
                    <p style={{
                        paddingLeft:"16px", fontSize: "14px"}}>Total Count: {this.state.totalCount}</p>
                </div>

{/* // Here starts the table */}
                <div className="container" style={{
                    justifyContent: "center",
                    padding: "30px",
                    borderLeft: "1px solid #f7f7f7",
                    borderRight: "1px solid #f7f7f7"
                }}>
                <MDBDataTable 
                hover
                theadColor="indigo"

                pagination = {true} 
                columns={this.state.columns}
                rows={this.state.rows}
                />


                </div>
                </div>

        )
    }
}
export default ErrorLog;
